const items = [];
for (const item of $input.all()) {
  const formData = item.json;
  const normalized = {
    source: 'Typeform - Website',
    rawData: formData,
    firstName: '',
    lastName: '',
    fullName: formData.name || formData.full_name || '',
    phone: formData.phone || '',
    email: formData.email || '',
    serviceType: formData.service_type || formData.serviceType || '',
    address: formData.address || '',
    message: formData.message || '',
    budget: formData.budget || 'Not mentioned',
    urgency: formData.urgency || 'Not mentioned',
    timestamp: new Date().toISOString()
  };
  if (normalized.fullName) {
    const nameParts = normalized.fullName.trim().split(' ');
    normalized.firstName = nameParts[0] || '';
    normalized.lastName = nameParts.slice(1).join(' ') || '';
  }
  normalized.phone = normalized.phone.replace(/[^0-9+]/g, '');
  items.push({ json: normalized });
}
return items;

