const items = [];
for (const item of $input.all()) {
  const lead = item.json;
  let scores = { serviceType: 5, location: 5, budget: 5, urgency: 5 };
  const serviceType = (lead.serviceType || '').toLowerCase();
  if (serviceType.includes('ac installation') || serviceType.includes('installation')) { scores.serviceType = 9; }
  else if (serviceType.includes('hvac repair') || serviceType.includes('repair')) { scores.serviceType = 8; }
  else if (serviceType.includes('home inspection') || serviceType.includes('inspection')) { scores.serviceType = 7; }
  else if (serviceType.includes('maintenance')) { scores.serviceType = 7; }
  else if (serviceType.includes('tune-up') || serviceType.includes('tuneup')) { scores.serviceType = 6; }
  else { scores.serviceType = 6; }
  const address = (lead.address || '').toLowerCase();
  if (address.includes('san diego') && !address.includes('county')) { scores.location = 10; }
  else if (address.includes('san diego county') || address.includes('chula vista') || address.includes('la mesa') || address.includes('el cajon') || address.includes('oceanside') || address.includes('carlsbad')) { scores.location = 8; }
  else if (address.includes('california') || address.includes('ca')) { scores.location = 6; }
  else if (address) { scores.location = 5; }
  const budget = (lead.budget || '').toLowerCase();
  if (budget.includes('5000') || budget.includes('5,000') || budget.includes('$5k') || budget.includes('premium') || budget.includes('10000') || budget.includes('10,000')) { scores.budget = 10; }
  else if (budget.includes('3000') || budget.includes('3,000') || budget.includes('4000') || budget.includes('4,000') || budget.includes('mid') || budget.includes('moderate')) { scores.budget = 8; }
  else if (budget.includes('1000') || budget.includes('1,000') || budget.includes('2000') || budget.includes('2,000') || budget.includes('basic') || budget.includes('affordable')) { scores.budget = 6; }
  else { scores.budget = 5; }
  const urgency = (lead.urgency || '').toLowerCase();
  const message = (lead.message || '').toLowerCase();
  if (urgency.includes('emergency') || urgency.includes('urgent') || urgency.includes('asap') || message.includes('emergency') || message.includes('urgent') || message.includes('asap')) { scores.urgency = 10; }
  else if (urgency.includes('this week') || urgency.includes('soon') || urgency.includes('today') || message.includes('this week') || message.includes('today')) { scores.urgency = 8; }
  else if (urgency.includes('this month') || urgency.includes('within 30 days') || message.includes('this month')) { scores.urgency = 6; }
  else if (urgency.includes('flexible') || urgency.includes('not urgent')) { scores.urgency = 4; }
  else { scores.urgency = 5; }
  const finalScore = Math.round((scores.serviceType + scores.location + scores.budget + scores.urgency) / 4);
  let leadTier = '';
  if (finalScore >= 8) { leadTier = 'Hot Lead'; }
  else if (finalScore >= 6) { leadTier = 'Warm Lead'; }
  else { leadTier = 'Cold Lead'; }
  const enrichedLead = { ...lead, leadScore: finalScore, leadTier: leadTier, scoreBreakdown: scores, scoredAt: new Date().toISOString() };
  items.push({ json: enrichedLead });
}
return items;

